import React from 'react';
import './css/About.css';
import lonelyfox from './static/avatar.png';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';

const Navigation = (props: StyledProps) => {
  const classes = props.classes;
  return (   
      <Container className={classes.navBar}>
          <Box className={classes.logoContainer}>
            <Avatar alt="Lonely Fox" src={lonelyfox} className={classes.avatar}></Avatar>
            <Typography className={classes.text}>Nathanael Shim</Typography>
          </Box>
          <Box display={{xs: 'flex', lg: 'flex'}}>
              <Link href="/" className={classes.text}> About </Link>
              <Link href="/projects" className={classes.text}> Projects </Link>        
              <Link href="/music" className={classes.text}>Music</Link>
          </Box>
      </Container>
  );
}

const useStyles = createStyles({
  navBar: {
    display: 'flex',
    backgroundColor: '#F7F3F2',
    alignItems: 'center',
    padding: '2rem',
  },
  logoContainer: {
    display: 'flex',
    backgroundColor: '#F7F3F2',
    flexGrow: 1,
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '1.5rem',
    padding: '1rem',
  },
  avatar: {
    fontSize: '1rem',
    width: 'auto',
    height: 'auto',
  },
});

export default withStyles(useStyles)(Navigation);
